&lt;h3&gt;Medium Heatsink&lt;/h3&gt;
&lt;p&gt;This is a medium-sized heatsink that has been designed to dissipate heat away from your boards and ICs. Each of these black anodized heatsinks is perfect when used in conjunction with our ESP32 Thing Power Control Shield, but it also fits the TO-220 package.&lt;/p&gt;

